import React from "react";
import { Icon, Modal } from "web3uikit";
import { useState }  from "react";

function User() {

  const [isVisible, setVisible] =  useState(false)

  return (
    <>
      <div onClick={() => setVisible}>
        <Icon fill="#000000" size={24} svg="user" />
      </div>
    </>
  );
}

export default User;
